import React, { Component} from 'react';
import axios from 'axios';

export default class Form extends Component {
    state = {
        maxDeliveryTimeMinutes:0,
        assignments:[]
    }

    async componentDidMount() {
        const url = 'http://localhost:8080/couriers';
        const response = await axios.get(url);
        const receivedAssignments = JSON.stringify(response.data.assignments);
        this.setState({assignments:receivedAssignments});
    }

    render(){
        return(
            <div>
                The best food order for the available couriers is:
                <div>
                    {this.assignments[0].courierId}, {assignments[0].orderId}, {assignments[0].deliveryTimeMinutes}
                </div>
            </div>
        );
    }
}
